*/

// @mui material components
import Box from '@mui/material/Box';
import Grid from "@mui/material/Grid";
import Card from "@mui/material/Card";
import Fab from '@mui/material/Fab';
import AddIcon from '@mui/icons-material/Add';
import CloudUploadIcon from '@mui/icons-material/CloudUpload';
// Material Dashboard 2 React components
import MDBox from "components/MDBox";
import MDTypography from "components/MDTypography";
import Button from '@mui/material/Button';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import TextField from '@mui/material/TextField';
// Material Dashboard 2 React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
import DataTable from "examples/Tables/DataTable";
import Paper from '@mui/material/Paper';
import { styled } from '@mui/material/styles';
// Data
import QuizData from "layouts/Quizzes/data/QuizData";
import MDButton from "components/MDButton";

function Quizzes() {
  const handleFileChange = (event) => {
    const file = event.target.files[0];
    // Handle the file change here
    console.log('Selected file:', file);
  };
  const { columns, rows } = QuizData();
  const Item = styled(Paper)(({ theme }) => ({
    backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  }));
  const VisuallyHiddenInput = styled('input')({
    clip: 'rect(0 0 0 0)',
    clipPath: 'inset(50%)',
    height: 1,
    overflow: 'hidden',
    position: 'absolute',
    bottom: 0,
    left: 0,
    whiteSpace: 'nowrap',
    width: 1,
  });
  const StyledButton = styled(Button)`
  && {
    background-color: #ff0000; /* Change this color to your desired color */
    color: #ffffff; /* Change text color if needed */
    /* Add any other styles you want for the button */
  }
`;
  return (
    <DashboardLayout>
      <MDBox pt={6} pb={3}>
        <Grid container spacing={6}>
          <Grid item xs={12}>
            <Card>
              <MDBox
                mx={2}
                mt={-3}
                py={3}
                px={2}
                variant="gradient"
                bgColor="info"
                borderRadius="lg"
                coloredShadow="info"
              >
                <MDTypography variant="h6" color="white">
                  Quiz list
                </MDTypography>
              </MDBox>
              <MDBox pt={3}>
                <DataTable
                  table={{ columns, rows }}
                  isSorted={false}
                  entriesPerPage={false}
                  showTotalEntries={false}
                  noEndBorder
                />
              </MDBox>
            </Card>
          </Grid>
          <Grid item xs={12}>
            <Card>
              <MDBox
                mx={2}
                mt={-3}
                py={3}
                px={2}
                variant="gradient"
                bgColor="info"
                borderRadius="lg"
                coloredShadow="info"
              >
                <MDTypography variant="h6" color="white">
                  Quiz Creation
                </MDTypography>
              </MDBox>
              <MDBox pt={3} justifyContent="center">
  <Box
    component="form"
    sx={{
      '& .MuiTextField-root': { m: 1, width: '25ch' },
      textAlign: 'center', // Aligning content center
    }}
    noValidate
    autoComplete="off"
    justifyContent="center"
  >
    <div>
    <TextField
        label="Quiz set Name"
        id="filled-size-normal"
        variant="standard"
      />
      <TextField
        label="Quiz Type"
        id="filled-size-normal"
        variant="standard"
      />
    </div>
    <div>
    <TextField
        label="Difficulty"
        id="filled-size-normal"
        variant="standard"
      />
     <label htmlFor="file-upload" style={{ display: 'inline-block' }}>
      <input
        id="file-upload"
        type="file"
        accept="image/*" // Define accepted file types (e.g., 'image/*' for images)
        style={{ display: 'none' }} // Hide the default file input
        onChange={handleFileChange}
      />
      <CloudUploadIcon /> Upload File
    </label>
    </div>
    <div>
    <TextField
        label="Size"
        id="filled-size-normal"
        variant="standard"
      />
      <label htmlFor="file-upload" style={{ display: 'inline-block' }}>
      <input
        id="file-upload"
        type="file"
        accept="image/*" // Define accepted file types (e.g., 'image/*' for images)
        style={{ display: 'none' }} // Hide the default file input
        onChange={handleFileChange}
      />
      <CloudUploadIcon /> Upload File
    </label>

    </div>
  </Box>
</MDBox>

            </Card>
          </Grid>
        </Grid>
      </MDBox>
      <Footer />
    </DashboardLayout>
  );
}

export default Quizzes;
